import React from "react";

export default function News() {
  let data = [];
  fetch(
    "https://newsapi.org/v2/everything?q=tesla&from=2022-05-08&sortBy=publishedAt&apiKey=14ca7051b89b45fca6adf6fc35da4824"
  ).then((response) => response.json().then((data) => data.push(data)));
  return (
    <div className="bg-gray-700 h-[100vh] border-[1px] border-gray-600 mt-[100px] max-w-[1400px] mx-auto">
      <h1 className="text-3xl text-gray-400 underline">NEWS</h1>
    </div>
  );
}
